import sys

def golden_plate():
    w, h, k = map(int, input().split())
    total = 0
    for i in range(1, k + 1):
        total += (w - 4 * (i - 1)) * (h - 4 * (i - 1))
    return total

if __name__ == "__main__":
    tests = int(input())
    for _ in range(tests):
        print(golden_plate())

def check_x(n, matrix):
    # Check if all letters on the diagonals are the same
    diagonal1 = [matrix[i][i] for i in range(n)]
    diagonal2 = [matrix[i][n-i-1] for i in range(n)]
    if len(set(diagonal1)) != 1 or len(set(diagonal2)) != 1:
        return "NO"

    # Check if all other squares contain the same letter that is different from the letters on the diagonals
    for i in range(n):
        for j in range(n):
            if (i != j and i != n-j-1 and j != n-i-1) or (matrix[i][j] != diagonal1[0] and matrix[i][j] != diagonal2[0]):
                return "NO"

    return "YES"

n = int(input())
matrix = []
for _ in range(n):
    matrix.append(input())

result = []
for test_case in matrix:
    result.append(check_x(n, [list(test_case)]))

print('\n'.join(result))

import sys

def read_input():
    n, l = map(int, input().split())
    a = list(map(int, input().split()))
    return n, l, a

def calculate_d(n, l, a):
    a.sort()
    min_d = 0.0
    max_dist = 0.0

    for i in range(n):
        if i == 0:
            max_dist = max(max_dist, l - a[i])
        elif i == n - 1:
            max_dist = max(max_dist, a[i] - 0)
        else:
            max_dist = max(max_dist, min(a[i] - a[i-1], a[i+1] - a[i]))

    min_d = max_dist / 2.0
    return min_d

def main():
    n, l, a = read_input()
    d = calculate_d(n, l, a)
    print(f"{d:.10f}")

if __name__ == "__main__":
    main()

import sys

def gcd(a, b):
    if b == 0:
        return a
    else:
        return gcd(b, a % b)

def lcm(a, b):
    return a // gcd(a, b) * b

