import sys

def read_input():
    n = int(sys.stdin.readline())
    left = sys.stdin.readline().strip()
    right = sys.stdin.readline().strip()
    return n, left, right

def solve(n, left, right):
    pairs = []
    used_right = [False] * n
    used_left = [False] * n
    char_to_index = {}
    for i in range(n):
        if left[i] != '?' and right[i] != '?':
            if left[i] == right[i]:
                pairs.append((i + 1, i + 1))
                used_left[i] = True
                used_right[i] = True
            else:
                if left[i] not in char_to_index:
                    char_to_index[left[i]] = []
                char_to_index[left[i]].append(i)
    for i in range(n):
        if left[i] == '?' or used_left[i]:
            continue
        if right[i] == '?':
            for j in range(n):
                if right[j] != '?' and not used_right[j]:
                    pairs.append((i + 1, j + 1))
                    used_left[i] = True
                    used_right[j] = True
                    break
        elif right[i] in char_to_index:
            for j in char_to_index[right[i]]:
                if not used_left[j]:
                    pairs.append((i + 1, j + 1))
                    used_left[j] = True
                    used_right[i] = True
                    break
    pairs.sort(key=lambda x: x[0])
    result = []
    for pair in pairs:
        result.append(' '.join(map(str, pair)))
    return '\n'.join(result)

