import sys

def read_input():
    lines = sys.stdin.readlines()
    n, x = map(int, lines[0].strip().split())
    vouchers = []
    for i in range(1, n + 1):
        li, ri, costi = map(int, lines[i].strip().split())
        vouchers.append((li, ri, costi))
    return n, x, vouchers

def solve(n, x, vouchers):
    vouchers.sort(key=lambda x: x[2])
    min_cost = float('inf')
    for i in range(n):
        for j in range(i + 1, n):
            if vouchers[i][1] < vouchers[j][0] or vouchers[j][1] < vouchers[i][0]:
                duration = vouchers[i][1] - vouchers[i][0] + 1 + vouchers[j][1] - vouchers[j][0] + 1
                if duration == x:
                    min_cost = min(min_cost, vouchers[i][2] + vouchers[j][2])
    return -1 if min_cost == float('inf') else min_cost

def main():
    n, x, vouchers = read_input()
    result = solve(n, x, vouchers)
    print(result)

if __name__ == "__main__":
    main()

