def get_intersection(line1, line2):
    a1, b1, c1 = line1
    a2, b2, c2 = line2
    denominator = a1 * b2 - a2 * b1
    if denominator == 0:
        return None
    x = (b1 * c2 - b2 * c1) / denominator
    y = (a2 * c1 - a1 * c2) / denominator
    return (x, y)

def is_colinear(line1, line2, point):
    a1, b1, c1 = line1
    a2, b2, c2 = line2
    px, py = point
    if a1 * (py - c1) + b1 * (px - a1) == 0 and a2 * (py - c2) + b2 * (px - a2) == 0:
        return True
    return False

def get_block(lines, point):
    block = set()
    for i in range(len(lines)):
        for j in range(i + 1, len(lines)):
            intersection = get_intersection(lines[i], lines[j])
            if intersection is not None and is_colinear(lines[i], lines[j], point):
                block.add((i, j))
                block.add((j, i))
    return block

