import sys

class UnionFind:
    def __init__(self, n):
        self.parent = list(range(n))
        self.rank = [0] * n
        self.size = [1] * n

    def find(self, x):
        if self.parent[x] != x:
            self.parent[x] = self.find(self.parent[x])
        return self.parent[x]

    def union(self, x, y):
        root_x = self.find(x)
        root_y = self.find(y)
        if root_x != root_y:
            if self.rank[root_x] < self.rank[root_y]:
                root_x, root_y = root_y, root_x
            self.parent[root_y] = root_x
            self.size[root_x] += self.size[root_y]
            self.rank[root_x] = max(self.rank[root_x], self.rank[root_y] + 1)

def main():
    input_lines = sys.stdin.readlines()
    output = []
    for i in range(0, len(input_lines), 2):
        n, k = map(int, input_lines[i].split())
        edges = []
        for j in range(i + 1, i + n - 1):
            u, v = map(int, input_lines[j].split())
            edges.append((u - 1, v - 1))
        uf = UnionFind(n)
        for u, v in edges:
            uf.union(u, v)
        sizes = {}
        for i in range(n):
            root = uf.find(i)
            sizes.setdefault(root, []).append(i)
        sorted_sizes = sorted(sizes.keys(), key=lambda x: (-uf.size[x], x))
        remove = []
        for size in sorted_sizes:
            if k == 0:
                break
            for node in sizes[size]:
                remove.append(node + 1)
                k -= 1
        output.append(' '.join(map(str, remove)))
    print('\n'.join(output))

